// SPDX-License-Identifier: MIT
pragma solidity 0.6.6;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

contract SimpleCollectible is ERC721 {
    function contractURI() public view returns (string memory) {
        return "https://raw.githubusercontent.com/gravitythestudio/maincontract/main/gravitythestudio";
        }

      function baseTokenURI() public view returns (string memory) {
          return "https://raw.githubusercontent.com/gravitythestudio/001-regaliadecay/main/simplecollectible";
    }



    uint256 public tokenCounter;

    constructor () public ERC721 ("Gravity the Studio", "GTS"){
        tokenCounter = 0;
    }


    function createCollectible(string memory) public returns (uint256) {
        uint256 newItemId = tokenCounter;
        _safeMint(msg.sender, newItemId);
        tokenCounter = tokenCounter + 1;
        return newItemId;
    }

}
